import React from 'react';
import { motion } from 'framer-motion';
import { AnimatePresence } from 'framer-motion';
import { Link } from 'react-router-dom';
function SideMenu() {
    const sliding={
        hidden:{x:-100},
        show:{x:-20}
    }

  return(
               <AnimatePresence>
                <motion.div className='sidemenu'
                variants={sliding}
                initial="hidden"
                animate="show">
                    
                <div className='sidemenu-'>
                    <div className='sidemenu-head'>
                    <img src="/images/chef-icon.png" width={100}  alt="chef illustration"/>
                    <h3>Mr Chef</h3>
                    <h6>Since 1999</h6>
                    </div>
                    <ul className='sidemenu-body'>
                        <li>Home</li>
                        <li>About Us</li>
                        <li>Menu</li>
                        <li>Contact Us</li>
                    </ul>
                    <div className='sidemenu-footer'>
                        <h3>Also Check</h3>
                        <h2><Link to='/'>Le Muse cuisine</Link></h2>
                        <h6>To order delicious delicacies</h6>
                    </div>
                </div>
            </motion.div>
            </AnimatePresence>
      )}


export default SideMenu;
